        ()=>{
            getProduct()
        },[]
        )
        async function getProduct(){
            let res = await fetch('https://fakestoreapi.com/products');
            let productList = await res.json();
            updateProduct(productList)
        }

        if(product.length === 0){
            return(
                <h1></h1>
            )
        }

    return(
        <h1 className="name">Hello,Mansoor Maaz</h1>
    )
}
